        <WeatherInfo />
      </div>

      <Routes>
        <Route path="thailand" element={<Thailand />} />

        <Route path="korea" element={<Korea />} />

        <Route path="malaysia" element={<Malaysia />} />
      </Routes>

      <Home />
      <Country />
    </div>
  );
}
